class Solution {

    /**
     * @param Integer[] $heights
     * @param Integer[][] $queries
     * @return Integer[]
     */
    function leftmostBuildingQueries($heights, $queries) {
        $n = count($heights);
        $maxRight = array_fill(0, $n, -1);
        $stack = [];

        // Preprocess to find the next greater element for each building
        for ($i = 0; $i < $n; $i++) {
            while (!empty($stack) && $heights[end($stack)] < $heights[$i]) {
                $maxRight[array_pop($stack)] = $i;
            }
            $stack[] = $i;
        }

        $ans = [];
        foreach ($queries as $query) {
            $a = $query[0];
            $b = $query[1];
            $found = false;

            if ($a < $b) {
                // Move Alice to the right
                while ($a < $n && $maxRight[$a] != -1 && $maxRight[$a] <= $b) {
                    if ($maxRight[$a] == $b) {
                        $found = true;
                        break;
                    }
                    $a = $maxRight[$a];
                }
            }

            $ans[] = $found ? $b : -1;
        }

        return $ans;
    }
}
